import BurgerMenu from '../BurgerMenu';
import NavigationDesktop from '../NavigationDesktop';

export default class Navigation extends React.Component {
  state = {
    menuOpen: false
  };
  render() {
    return (
      <nav>
        <NavigationDesktop />
        <BurgerMenu />
      </nav>
    );
  }
}
